        console.log(context)
    }
    render() {
        return (
            <div>
                <h1>The Main Page of {this.props.appName}</h1>
                <p>
                    Go to{" "}
                    <Link href="/auth">
                        <a>Auth</a>
                    </Link>
                </p>
                <button onClick={() => Router.push("/auth")}>Go to Auth</button>
            </div>
        );
    }
};

export default IndexPage;
